val df1 = spark.read.option("header", "true").csv("hdfs:///tmp/dota2/cuss_chat.csv")

df1.show(10, true) // true : 내용이 길면 ...화 되는 것! false로 하면 풀네임이 나옴
// API 문서찾을 때 Dataset을 찾아보면 됩니다!!


df1.count

// TempView 생성
df1.createOrReplaceTempView("dotachat")

